  "NOTE": "14:44 se presenta un desplome de una estructura en una obra presentando una persona atrapada y 2 heridas.14:50 se activa unidad de rescate a solicitud de coe 7. 14:50 inicia dezplazamiento coe 7 y coe 22 en movil 7. 15:20 llegada al sitio de coe 7. 15:27 Coe 7 reporte tres personas afectadas en el sitio (1 trasladada, 1 no amerita traslado y 1 persona sin signos vitales). Informa que se trata de una obra con contrato Numero 106 de 2005 de la empresa SINCOM KMA, y que la obra esta a cargo del se�or Pedro Viola con cc 903841 de Cartagena. 15:41 Coe 7 solicita presencia de fiscalia. 15:53 Coe 7 reporta datos de los afectados asi: Heriberto Gomez de 38 a�os con trauma facial por esquirlas en la cara, trasldado al hospital San Ignacio por la 5051 - CArmelo Jimenez de 61 a�os con trauma en tejidos blandos y rodilla (no amerita traslado) - y Manuel Castro de aproximadamente 40 a�os (persona sin signos vitales). 15:50 se contacta al se�or Juan Carlos Gutierrez de la fiscalia quien manifiesta que dicha activacion debe hacerla las unidades de ponal que atienden el evento y lo deben solicitar a la unidad de reparto del cti. 17:40 reporta alcaldia 11 la recuperacion del cuerpo quedando en manos del cti. 14:44 SE PRESENTA UN DESPLOME DE UNA ESTRUCTURA EN UNA OBRA PRESENTANDO UNA PERSONA ATRAPADA Y 2 HERIDAS.14:50 SE ACTIVA UNIDAD DE RESCATE A SOLICITUD DE COE 7. 14:50 INICIA DEZPLAZAMIENTO COE 7 Y COE 22 EN MOVIL 7. 15:20 LLEGADA AL SITIO DE COE 7. 15:27 COE 7 REPORTE TRES PERSONAS AFECTADAS EN EL SITIO (1 TRASLADADA, 1 NO AMERITA TRASLADO Y 1 PERSONA SIN SIGNOS VITALES). INFORMA QUE SE TRATA DE UNA OBRA CON CONTRATO NUMERO 106 DE 2005 DE LA EMPRESA SINCOM KMA, Y QUE LA OBRA ESTA A CARGO DEL SENOR PEDRO VIOLA CON CC 903841 DE CARTAGENA. 15:41 COE 7 SOLICITA PRESENCIA DE FISCALIA. 15:53 COE 7 REPORTA DATOS DE LOS AFECTADOS ASI: HERIBERTO GOMEZ DE 38 ANOS CON TRAUMA FACIAL POR ESQUIRLAS EN LA CARA, TRASLDADO AL HOSPITAL SAN IGNACIO POR LA 5051 - CARMELO JIMENEZ DE 61 ANOS CON TRAUMA EN TEJIDOS BLANDOS Y RODILLA (NO AMERITA TRASLADO) - Y MANUEL CASTRO DE APROXIMADAMENTE 40 ANOS (PERSONA SIN SIGNOS VITALES). 15:50 SE CONTACTA AL SENOR JUAN CARLOS GUTIERREZ DE LA FISCALIA QUIEN MANIFIESTA QUE DICHA ACTIVACION DEBE HACERLA LAS UNIDADES DE PONAL QUE ATIENDEN EL EVENTO Y LO DEBEN SOLICITAR A LA UNIDAD DE REPARTO DEL CTI. 17:40 REPORTA ALCALDIA 11 LA RECUPERACION DEL CUERPO QUEDANDO EN MANOS DEL CTI. |"
