  "NOTE": " INFIORMAN DE UN DESLIZAMIENTO DE TIERRA EN EL LUGAR. | SE DESPACHA LA MAQUINA R-34 AL LUGAR. | SE DESPACHA LA MOVIL 5656 AL LUGAR. | INFORMAN QUE HAY VARIAS VIAS CERRADAS, NO HAN PODIDO LLEGAR, AL LUGAR, PIDEN AYUDA A LA POLICIA PARA QUE LOS GUIE. | A LA HORA BOMBEROS NOS INFORMAN QUE SE RESCATARON DOS PERSONAS 9-01, SE REQUIERE FISCALIA. | CONFIRMAN LA DIRECCION DIAG. 74A CON 68C, EMPLEADOS DE UNA OBRA DE LA EMPRESA UNION TEMPORAL BOGOTA, HACIENDO TRABAJOS EN EL SECTOR, INFORMAN BOMBEROS TAMBIEN QUE TIENEN PROBLEMAS DE COMUNICACIONES CON EL LUGAR. | SE LE REPORTA A COE 10 DA LAS INSTRUCCIONES A SEGUIR. | 1.SE LE REPORTA A COE 10 ANDRES FIERRO SOBRE EL EVENTO EL CUAL SE DESPLAZA HACIA EL LUGAR DEL INCIDENTE JUNTO CON COE 6 Y COE 22 EN LA MOVIL 6. | 1. COE 6 Y 10 LLEGA AL LUGAR DEL INCIDENTE PENDIENTE EL REPORTE. 2.COE 6 JORGE PARDO REPORTA:QUE SE TRATO DE UNA EXCAVACION APROXIMADAMENTE DE 3 METROS DE PROFUNDIDAD PARA LA INSTALACION DE TUBERIA DEL ACUEDUCTO. EN LA EXCAVACION SE PRODUCE UN DESLIZAMIENTO O FALLA AL TRATAR UNOS OBREROS DE REALIZAR UN APUNTALAMIENTO PARA SOPORTAR PARTE DE LA ESTRUCTURA. EN EL ACCIDENTE LABORAL MUEREN 2 PERSONAS QUE RESPONDIAN A LOS NOMBRES DE EDGAR MARTINEZ CON CC 79864590 Y EL SENOR LUBARDO BELTRAN CON CC 80362609 LAS LABORES DE RESCATE LAS REALIZARON LOS CONTRATISTAS ENCARGADOS DE LAS OBRAS POR PARTE DEL ACUEDUCTO (UEL ACUEDUCTO).NO SE PRESENTARON LESIONADOS Y QUEDA A CARGO DEL EVENTO POLICIA Y PERSONAL DEL ACUEDUCTO. SE DETERMINA EL CESE DE LAS OPERACIONES O TRABAJOS EN EL LUGAR EN TANTO NO SE REVISE EL SISTEMA DE APUNTALAMIENTO Y SE TOMEN LAS MEDIDAS DE MITIGACION NECESARIAS. QUEDA PENDIENTE EL LEVANTAMIENTO DE LOS CUERPOS POR PARTE DE FISCALIA.SE RETIRAN DEL PUNTO COE 10, 6,22 MOVIL 6 Y PRENSA 2. |"
