  "NOTE": "REPORTAN QUE FRENTE AL CEMENTERIO CERAFIN SE PRESENTA UN DESLIZAMIENTO DE TIERRA Y HAY UNA PERSONA ATRAPADA. | BOMBEROS INFORMA QUE DESPLAZA LA M 92 PARA HACER VERIFICACION EN EL LUGAR. | LA SDS INFORMA QUE DESPLAZA LA AMBULANCIA 5777 AL SITIO PARA HACER VALORACION DE PACIENTES. | SE LE REPORTA LA NOVEDADE A COE 16 MAURICIO DELGADO INGENIERO SOBRE EL INCIDENTE. | SOLICITA REPORTARLE A LA ALCALDIA LOCAL Y AL GESTOR DE LA MISMA PARA QUE QUEDE INFORMADO Y A SU VEZ REALICE EN CONJUNTO CON EL CLE LAS DISTINTAS COORDINACIONES POR PARTE DE LOS GRUPOS OPERATIVOS. REPORTARLE A ASISTENCIA TECNICA PERA QUE TENGA CONOCIMIENTO DE LA NOVEDAD Y DESPLACE UN INGENIERO AL SITIO. | BOMBEROS INFORMA QUE LLEGA AL LUGAR. | REPORTAN QUE SE PRESENTA UN DESLIZAMIENTO DE TIERRA Y ROCA, ESTE CAE SOBRE EL CAMBUCHE DE UN HABITANTE DE LA CALLE EL CUAL SE ENCUENTRA SIN SIGNOS VITALES Y EL CUERPO ESTA ATRAPADO. SOLICITAN INGENIERO DE FOPAE PARA LA VALORACION DEL TERRENO YA QUE HAY UNA ROCA DE 5 TONELADAS APROXIMADAMENTE CON RIESGO DE CAER. | SE LE BRINDA INFORMACION PARA VERIFICACION Y SEGUIMIENTO. | LA SDS INFORMA QUE LLEGA AL LUGAR Y A CARGO SE ENCUENTRA EL DOCTOR ALVARO RUIZ. | ENTERADO DE LA NOVEDAD COE 27 INGENIERO DIEGO PLAZAS. | SOLICITA AVISAR A FISCALIA YA QUE FALLECIO UNA PERSONA EN EL LUGAR. ENTERADA FISCALIA SRA AMPARO. | REPORTA QUE SE DESPLAZA AL LUGAR A REALIZAR LA RESPECTIVA VERIFICACION DEL TERRENO. | INFORMA QUE INICIA DESPLAZAMIENTO UN INGENIERO DE OBRAS, PARA REALIZAR LA VERIFICACION RESPECTIVA DEL DESLIZAMIENTO DE ROCA. | REPORTAN QUE HACE PRESENCIA EL GRUPO USAR Y SE NECESITA APUNTALAR EL SITIO PERO ANTES DE EFECTUAR EL RESCATE CON PERSONAL DE FISCALIA O POLICIA JUDICIAL. A CARGO SE ENCUENTRA EL CABO ESPINOSA. | SE ENCUENTRA EN EL SITIO. | SE ENCUENTRA EN EL PUNTO. | INFORMA POR SOLICITUD DE COE 1- ING. GUILLERMO ESCOBAR, SE REQUIERA A COE 27 - ING. DIEGO PLAZAS REGISTRO FOTOGRAFICO DEL LUGAR PARA QUE SEA ENVIADO DE CARACTER URGENTE POR MAIL. | REPORTAN QUE EN EL LUGAR YA SE ENCUENTRA PERSONAL DE FISCALIA HACIENDO EL LEVANTAMIENTO DEL CUERPO Y LA AMBULANCIA SE RETIRA DEL LUGAR PARA LA ATENCION DE OTRO INCIDENTE. | INFORMA EN LA CALLE 75 SUR CON 4 SOBRE LA AV. BOYACA FRENTE A LA ENTRADA DEL CEMENTERIO SERAFIN, EN UN LOTE VACIO DE APROX. 2 A 3 HECTAREAS SE EVIDENCIA POR LA DEGRADACION DEL TERRENO DESPRENDIMIENTO DE APROX. 15 MTS3 DE MATERIAL QUE CAEN ENCIMA DE UN HABITANTE DE LA CALLE GENERANDO LA MUERTE, VA A REALIZAR UN APUNTALAMIENTO PORQUE SE PRESENTAN 2 ROCAS EN RIESGO DE CAER, PARA QUE PUEDAN REALIZAR EL LEVANTAMIENTO DEL CADAVER. | REPORTAN QUE HACE PRESENCIA LA M-114 AL MANDO DEL BOMBERO PENA Y DOS INTEGRANTES DEL GRUPO USAR. | A LA HORA SE INICIA EL PERIODO OPERACIONAL EN EL INCIDENTE DE LA AURORA. | EL COMANDANTE DE INCIDENTE SARGENTO ROMERO INFORMA QUE NO SOLICITA MAS APOYO DE PERSONAL NI DE EQUIPO. | INFORMA A LA HORA SE TERMINAN LABORES SE RECUPERO EL CUERPO DE UNA PERSONA DE SEXO MASCULINO NO SE PUDO DETERMINAR LA EDAD YA QUE SE ENCONTRABA EN ALTO GRADO DE DESCOMPOSICION | SE CONSULTA CON COE 27 ING. DIEGO PLAZAS INDICA QUE EL EVENTO SE PUEDE CERRAR YA EN EL PUNTO SE DEJARON LAS RECOMENDACIONES PERTINENTES. | ASIGNA NIVEL DE EMERGENCIA 1. |"
